	<style>

.cucumber-react .cucumber-status--passed {

.cucumber-react .cucumber-status--pending {

}
.cucumber-react .cucumber-status--undefined {

}
.cucumber-react .cucumber-status--ambiguous {

}

}

}

.cucumber-react .cucumber-title__keyword {

}

}
.cucumber-react .cucumber-tags {
  padding: 0;

}
.cucumber-react .cucumber-tags .cucumber-tag {
  display: inline;
  list-style-type: none;
  padding: 4px 8px 4px 8px;
  margin-right: 6px;
  background-color: #FFFFFF;
  border-radius: 6px;
}
.cucumber-react .cucumber-feature__icon {

}
.cucumber-react .cucumber-description,

.cucumber-react .cucumber-feature,

.cucumber-react .cucumber-scenario,
.cucumber-react .cucumber-background {

.cucumber-react .cucumber-steps {

}
.cucumber-react .cucumber-steps .cucumber-step__status {

}

  margin-right: 0.5em;
}
.cucumber-react .cucumber-attachment__image {

  position: relative;

  align-items: center;
  margin-top: 0.3em;
}
.cucumber-react .cucumber-anchor__link {
  opacity: 0;
  transition: all 0.35s ease-in-out;
  position: absolute;
  left: -20px;
  display: flex;
  align-items: center;
}
.cucumber-react .cucumber-anchor__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-anchor:hover a {
  opacity: 1;
  width: max-content;
  transition: all 0.35s ease-in-out;
}
.cucumber-react .cucumber-anchor > * {
  height: 100%;
  margin-top: 0px;
}

.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);
  font: 11px "Open Sans", sans-serif;
  margin-bottom: 1em;
}
.cucumber-report-header > * {
  padding: 1em;
}
.cucumber-report-header .cucumber-status-filter {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-status-filter table {
  width: 100%;
}
.cucumber-report-header .cucumber-execution-data {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-search-bar {
  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {
  height: 2.2em;
  padding-left: 0.6em;
  padding-right: 0.6em;
}
.cucumber-report-header .cucumber-search-bar p.help {

.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {

}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li {
  list-style-type: none;
  display: inline-block;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {
  display: inline-block;
  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }
}
.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

{"source":{"uri":"features/specs/cadastro.feature","data":"#language: pt\n\nFuncionalidade: Cadastro\n    Sendo um músico que possui equipamentos musicais\n    Quero fazer o meu cadastro no RockLov\n    Para que eu possa disponibilizá-los para locação\n\n    Contexto: Página de login\n        Dado que acesso a página de cadastro\n\n    @cadastro\n    Cenario: Fazer cadastro\n\n        Quando submeto o seguinte formulário de cadastro:\n            | nome              | email                    | senha    |\n            | Anderson Oliveira | anderson.teste@teste.com | Senha123 |\n        Então sou redirecionado para o Dashboard\n\n    @tentativa_cadastro\n    Esquema do Cenario: Tentativa de cadastro\n\n        Quando submeto o seguinte formulário de cadastro:\n            | nome         | email         | senha         |\n            | \u003cnome_input\u003e | \u003cemail_input\u003e | \u003csenha_input\u003e |\n        Então vejo a mensagem de alerta: \"\u003cmensagem_output\u003e\"\n\n        Exemplos:\n            | nome_input        | email_input        | senha_input | mensagem_output                  |\n            |                   | anderson@gmail.com | Senha123    | Oops. Informe seu nome completo! |\n            | Anderson Oliveira | anderson#gmail.com | Senha123    | Oops. Informe um email válido!   |\n            | Anderson Oliveira |                    | Senha123    | Oops. Informe um email válido!   |\n            | Anderson Oliveira | anderson@gmail.com |             | Oops. Informe sua senha secreta! |","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/cadastro_anuncios.feature","data":"#language: pt\n\nFuncionalidade: Cadastro de Anúncios\n    Sendo usuário cadastrado na rocklov que possui equipamentos músicais\n    Quero cadastrar meus equipamentos\n    Para que eu possa disponibilizalos para locação\n\n    Contexto: Login\n        * Login com \"anderson.teste@gmail.com\" e a senha \"Senha123\"\n\n    @cadastro_equipo\n    Cenário: Novo equipamento\n        Dado que acesso o formulário de cadastro de anúncio\n            E que eu tenho o seguinte equipamento\n            | img       | fender-sb.jpg |\n            | nome      | Fender Strato |\n            | categoria | Cordas        |\n            | preco     | 200           |\n        Quando submeto o cadastro desse item\n        Então devo ver esse item no meu Dashboard\n\n    Esquema do Cenário: Tentativa de cadastro de anúncio\n        Dado que acesso o formulário de cadastro de anúncio\n            E que eu tenho o seguinte equipamento\n            | img       | \u003cfoto\u003e             |\n            | nome      | \u003cnome_equipamento\u003e |\n            | categoria | \u003ccategoria\u003e        |\n            | preco     | \u003cpreco\u003e            |\n        Quando submeto o cadastro desse item\n        Então deve conter a mensagem de alerta \"\u003cmensagem_output\u003e\"\n\n        Exemplos:\n            | foto          | nome_equipamento | categoria          | preco | mensagem_output                      |\n            |               | Violão de nylon  | Cordas             | 150   | Adicione uma foto no seu anúncio!    |\n            | clarinete.jpg |                  | Outros             | 200   | Informe a descrição do anúncio!      |\n            | baixo.jpg     | Baixo            |                    | 100   | Informe a categoria                  |\n            | amp.jpg       | Caixa de som     | Áudio e Tecnologia |       | Informe o valor da diária            |\n            | amp.jpg       | Caixa de som     | Áudio e Tecnologia | abc   | O valor da diária deve ser numérico! |\n            | amp.jpg       | Caixa de som     | Áudio e Tecnologia | 150A  | O valor da diária deve ser numérico! |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/login.feature","data":"#language: pt\n\nFuncionalidade: Login\n    Sendo um usuário cadastrado\n    Quero acessar o sistema da Rocklov\n    Para que eu possa anunciar meus equipamentos musicais\n\n    @login\n    Cenario: Login do usuário\n\n        Dado que acesso a página principal\n        Quando submeto minhas credenciais com \"anderson.teste@gmail.com\" e \"Senha123\"\n        Então sou redirecionado para o Dashboard\n\n    Esquema do Cenário: Tentar Logar\n        Dado que acesso a página principal\n        Quando submeto minhas credenciais com \"\u003cemail_input\u003e\" e \"\u003csenha_input\u003e\"\n        Então vejo a mensagem de alerta: \"\u003cmensagem_output\u003e\"\n\n        Exemplos:\n            | email_input              | senha_input | mensagem_output                  |\n            | anderson.teste@gmail.com | 123teste    | Usuário e/ou senha inválidos.    |\n            | anderson.teste@yahoo.com | Senha123    | Usuário e/ou senha inválidos.    |\n            | anderson.teste*yahoo.com | Senha123    | Oops. Informe um email válido!   |\n            |                          | Senha123    | Oops. Informe um email válido!   |\n            | anderson.teste@gmail.com |             | Oops. Informe sua senha secreta! |","mediaType":"text/x.cucumber.gherkin+plain"}},
